import {BrowserRouter as Router, Route, Routes} from "react-router-dom";

import Top from "./components/Top";

console.log(icon_perfil);

console.log(logo);

function App() {
  return (

    <Router>
      <Routes>
        <Route path="/" element={<Top/>}/>
        <Route path="/Libros" element={<h1>a</h1>}/>
      </Routes>
    </Router>
  );
}


export default App;
